def viewSummaryByQuestion():
    """
    this method with compute and display the summary of a specific question
    all questions will be printed the the user will select which question number to summarize
    The method will put all the responses in the selected question in a list or tuple, then using  the count function
    the frequency of the responses will be determined .

    :return:
    """
    qnIndex = []

    # this will create and populate a list which will have an index of the Questions
    # so that we can know how many questions are in the survey
    for i in range(1,len(theDefaultSurveyDict[1])+1):
        qnIndex.append(i)

    # print(qnIndex)

    qnNbr = int()
    repeatLoop  = True
    while repeatLoop :
        try:
            # print all the questions1

            os.system('cls')
            print("The Default survey questions were.")
            print("===================================")
            for value in theDefaultSurveyDict[1]:
                print("{} :".format(value) + theDefaultSurveyDict[1][value].get_surveyQuestion())

            qnNbr = int(input("Please enter a question number to analyze(1 - {})( Enter 0 to quit):".format(len(qnIndex))))
        except:
            print("Invalid entry")
        else:
            if qnNbr in qnIndex :
                os.system('cls')
                print("analyzing question {} which had {} respondents:".format(qnNbr,len(theDefaultSurveyDict)))

                answerList = []

                for i in range(1, len(theDefaultSurveyDict) + 1):
                    # print(theDefaultSurveyDict[i][qnNbr].get_surveyQuestionAnswer())
                    answerList.append(theDefaultSurveyDict[i][qnNbr].get_surveyQuestionAnswer())

                valueFrequencyDict = Counter(answerList)

                # print(valueFrequencyDict.keys())
                # print(valueFrequencyDict)

                # get the total value of the frequencies of the options
                frequencySum = 0
                for value in valueFrequencyDict:
                    frequencySum = frequencySum + valueFrequencyDict[value]

                #print(" the total is {}".format(frequencySum))

                # for value in valueFrequencyDict:print(value + ": {:.1%}".format(valueFrequencyDict[value]/frequencySum))

                valuePercentageDict = {} # this will hold the options as dict keys  and percentages as the value

                for value in valueFrequencyDict: valuePercentageDict[value] = (valueFrequencyDict[value]/frequencySum)

                # print(valuePercentageDict)

                # print the analysis
                # this section will print the question specified by the qnNbr value which was chosen in order to indicate
                # which question was to be summarized
                # please note that it is assumed the all the surveys answered the same number of questions in the same
                # order. this means that question number 3 of survey number 1 is the same question 3 for
                # survey number 88. is theDefaultSurveyDict[surveyNbr][qnNbr].whatIsThequestion, is the
                # same for all values of surveyNbr that are valid

                surveyNbr = 1
                # print("QUESTION {}: ".format(qnNbr) + theDefaultSurveyDict[surveyNbr][qnNbr].get_surveyQuestion())
                dictToWrite = {}
                aString = "QUESTION {}".format(qnNbr)
                dictToWrite[str(aString)] = theDefaultSurveyDict[surveyNbr][qnNbr].get_surveyQuestion()
                print("QUESTION {}:{}".format(qnNbr,theDefaultSurveyDict[surveyNbr][qnNbr].get_surveyQuestion()))
                for value in valuePercentageDict:
                    print("OPTION : " + value +" ===> {:.2%}".format(valuePercentageDict[value]))
                    dictToWrite[value] = str(round(valuePercentageDict[value]*100,1)) + "%"
                doYouWantToSaveToFile = 0

                # print(dictToWrite)

                try:
                    doYouWantToSaveToFile = int(input("Do you wish to save this analysis to file?(Yes = 1,No = 0):"))
                except:
                    print("Invalid input means not save")
                else:
                    if doYouWantToSaveToFile == 1:
                        print("You chose to save")
                        df = pd.DataFrame(dictToWrite.items())
                        excel_filename = "question{}summary.xlsx".format(qnNbr)
                        csv_filename = "question{}summary.csv".format(qnNbr)

                        df.to_excel("question{}summary.xlsx".format(qnNbr),index=False,header=False)
                        df.to_csv("question{}summary.csv".format(qnNbr), index=False, header=False)

                        print("Results exported to Excel ==> {} and csv ==> {}".format(excel_filename,csv_filename))

                        print("Results ")
                    else:
                        print("You chose not to save")

                print("offer to analyze another question")
                print("if not, exit to the previous menu")
            else:
                print("choice out of range or is 0. exiting...")
                repeatLoop = False







